import React, { Component } from 'react';
import classes from './Ideaforms.module.css';




class Ideaforms extends Component {
    state = {
        collapseID: "",
        records: []
    };

    componentDidMount() {
        const url = 'http://localhost:5000/';
        fetch(url)
            .then(res => {
                return res.json();
            })
            .then(resdata => {
                this.setState({ records: resdata.recordlist });
                console.log(this.state.records);
            })
            .catch(err => {
                console.log(err);
            });
    }
    render() {
        const ideas = this.state.records.map(record => {
            return (
                <div className={classes.parent}>
                    <div className={classes.container}>
                        <h4 className={classes.title}> startup 1 </h4>
                        <button className={classes.btn}>
                            {this.props.upvote} upvotes
                </button>
                    </div>
                </div>
            );
        });

    }
}

export default Ideaforms;
